import React from "react";
import { motion } from "framer-motion";
import "../styles/global.css";

const Home = () => {
  return (
    <motion.section className="home-section"
      initial={{ opacity: 0, y: 50 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6 }}
    >
      <h1 className="home-title">Hey there, I'm <span className="name">Jose Chemmanoor</span></h1>
      <motion.p className="home-subtitle"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 1, duration: 1 }}
      >
        UI/UX Designer | Front-End Developer | Student
      </motion.p>
    </motion.section>
  );
};

export default Home;
